import React from "react";

const Todo = ({ todos, ischecked }) => {
  return <div>{todos.ischecked ? "체크됨" : "체크안됨"}</div>;
  {
    todos.map((item) => {
      return (
        <div>
          {item.text}
          <button>수정</button>
          <button>삭제</button>
        </div>
      );
    });
  }
};

export default Todo;
